def recursion(_A,_B,a):
	_cadena=""
	for i in range(len(a)):
		pasa=0
		for j in range(len(_A)):
			if a[i]==_A[j]:
				_cadena+=_B[j]
				pasa=1
		if pasa==0:
			_cadena+=a[i]
			#pasa=0

	return _cadena

class peano():
	"""
	Esta clase genera la cadena de L-system para hacer  la estructura fisica de la  antena 
	en este caso es para la cadena de recursion de Peano y con n como numero 
	de recursion que  debe de instroducirse en la clase
	"""
	def __init__(self,n):
		self.cadena=""
		self.n=n
		A=["R","L"]
		B=["RFLFR+F+LFRFL-F-RFLFR","LFRFL-F-RFLFR+F+LFRFL"]
		axioma="L"
		for i in range(n):
			axioma=recursion(A,B,axioma)
		self.cadena=axioma

class cuadrito():
	def __init__(self, _centrox_,_centroy_,_lado_):
		self.centrox=_centrox_
		self.centroy=_centroy_
		self.lado=_lado_
		self.d=self.lado/2.0
		self.e=self.lado/4.0
		#Se calculan los 5 vetices del segmento 
		self.vertice=[]
		self.vertice.append([self.centrox,self.centroy])			  #Vertice 0
		self.vertice.append([self.centrox+self.d,self.centroy-self.d])#Vertice 1
		self.vertice.append([self.centrox+self.d,self.centroy+self.d])#Vertice 2
		self.vertice.append([self.centrox-self.d,self.centroy+self.d])#Vertice 3
		self.vertice.append([self.centrox-self.d,self.centroy-self.d])#Vertice 4
		#Se calculan las coordenadas de cada vertice
		self.triangulo_coordenadas=[]
		self.triangulo_coordenadas.append([[self.vertice[3][0],self.vertice[3][1]],[self.vertice[4][0],self.vertice[4][1]],[self.vertice[1][0],self.vertice[1][1]]]) #Triangulo 0
		self.triangulo_coordenadas.append([[self.vertice[1][0],self.vertice[1][1]],[self.vertice[2][0],self.vertice[2][1]],[self.vertice[3][0],self.vertice[3][1]]]) #Triangulo 1

		#Se inicializan los puntos en cero  de  cada vertice 
		self.triangulo_puntos=[]
		self.triangulo_puntos.append([0,0,0]) #Triangulo 0
		self.triangulo_puntos.append([0,0,0]) #Triangulo 1

		#Se calculan los puntos de cruz dentro de cada triangulo
		self.cruz=[]
		self.cruz.append([self.centrox*1.0+self.e,1.0*self.centroy+self.e])# cruz 0
		self.cruz.append([self.centrox*1.0-self.e,1.0*self.centroy-self.e])# cruz 1
		#self.cruz.append([self.centrox,self.centroy+self.e])# cruz 2
		#self.cruz.append([self.centrox-self.e,self.centroy])# cruz 3
	def _feed_(self):
		#Si el punto es feed entonces se deshabilitan los vertices
		self.triangulo_coordenadas[0]=([[-10000.0,-10000.0],[-10000.0,-10000.0],[-10000.0,-10000.0]]) #Triangulo 0
		self.triangulo_coordenadas[1]=([[-10000.0,-10000.0],[-10000.0,-10000.0],[-10000.0,-10000.0]]) #Triangulo 1
		#Si el punto es feed entonces se deshabilitan los vertices
		self.vertice[0]=([-10000.0,-10000.0])#Vertice 0
		self.vertice[1]=([-10000.0,-10000.0])#Vertice 1
		self.vertice[2]=([-10000.0,-10000.0])#Vertice 2
		self.vertice[3]=([-10000.0,-10000.0])#Vertice 3
		self.vertice[4]=([-10000.0,-10000.0])#Vertice 4
		self.triangulo_puntos[0]=[-10000,-10000,-10000]
		self.triangulo_puntos[1]=[-10000,-10000,-10000,]

	def _CargaPunto(self,vector):
		for i in  range(len(vector)):
			for j in range(len(self.triangulo_coordenadas)): 
				for k in range(len(self.triangulo_coordenadas[0])):
					if  vector[i][1]==self.triangulo_coordenadas[j][k][0]  and  vector[i][2]==self.triangulo_coordenadas[j][k][1]:
						self.triangulo_puntos[j][k]=vector[i][0]

class  segmentos():
	def __init__(self,_paso_,iteracion):
		self.x=0
		self.y=0
		self.direccion=0
		_cadena_=""
		tmp=peano(iteracion)
		self.cadena=tmp.cadena
		self.paso=_paso_
		self.vector=[]
		self.vector.append([self.x,self.y])
		self.max_x=0.0
		self.max_y=0.0
		self.max_seg=0
		for i in range(len(self.cadena)):
			#Determina primero la direccion
			#print "<>",self.cadena[i]
			if  self.cadena[i]=="+":
				self.direccion+=90
			elif self.cadena[i]=="-":
				self.direccion-=90
			elif self.cadena[i]=="F":
			#Aqui se redefinen los angulos del cursor 
				if self.direccion>0:
					volante=[0,90,180,-90]
					tmp0=0
					tmp1=0
					k=0
					while tmp0!=self.direccion:
						tmp0+=90
						k+=1
						if k>=5:
							k=0
					self.direccion=volante[k]
				elif self.direccion<0:
					volante=[0,-90,180,90]
					tmp0=0
					tmp1=0
					k=0
					while tmp0!=self.direccion:
						tmp0-=90
						volante[k]
						k+=1
						if k>=5:
							k=0
					self.direccion=volante[k]
				#Aqui se generan los pasos por medio de  avance F
				if self.direccion==0:
					for j in range(self.paso):
						self.x+=1
						self.vector.append([self.x,self.y])
				elif self.direccion==90:
					for j in range(self.paso):
						self.y+=1
						self.vector.append([self.x,self.y])
				elif self.direccion==180:
					for j in range(self.paso):
						self.x-=1
						self.vector.append([self.x,self.y])
				elif self.direccion==-90:
					for j in range(self.paso):
						self.y-=1
						self.vector.append([self.x,self.y])
		self.vector_noRepetidos=[]
		for _x in range(len(self.vector)):
			agrega=1
			for _y in range(len(self.vector_noRepetidos)):
					if self.vector[_x]==self.vector_noRepetidos[_y]:   
						agrega=0
			if agrega==1:
				self.vector_noRepetidos.append(self.vector[_x])
		self.vector=self.vector_noRepetidos
		#Aqui se asignan los segmentos
		self.segmento=[]
		for i in range(len(self.vector)):
			self.segmento.append(cuadrito(self.vector[i][0]*1.0,self.vector[i][1]*1.0,1.0))
			self.max_x=self.vector[i][0]*1.0
			self.max_y=self.vector[i][1]*1.0
		self.max_seg=len(self.vector)



def GenAntenna(archivo,iteracion,escala_abs,feed,seg):
	numero=1
	escala_abs=(1000.0/escala_abs)
	conteo=0
	I=segmentos(seg,iteracion)
	lado=0.1 # metros
	max_seg=I.max_seg
	feed_prueba=int(max_seg*feed)
	nombre="%s.m" %(archivo)
	#Se crea el punto de feed
	I.segmento[feed_prueba]._feed_()
	#Se Verifica que el punto de alimentacion no  coincida con una esquina
	esquina=0
	if I.segmento[feed_prueba-1].vertice[0][0]!=I.segmento[feed_prueba+1].vertice[0][0]  and  I.segmento[feed_prueba-1].vertice[0][1]!=I.segmento[feed_prueba+1].vertice[0][1]:
		esquina=1
	if esquina==1:
		print ("corner ")
	if esquina==0: #Si el punto  de alimentacion no es esquina , procede
		#Se listan todos los puntos  
		puntos_x=[] # puntos brutos 
		puntos_y=[] # puntos brutos 
		for i in range(max_seg):
			for j in range(1,5):
				if I.segmento[i].vertice[j][0]!=-10000.0  and  I.segmento[i].vertice[j][1]!=-10000.0:
					puntos_x.append(I.segmento[i].vertice[j][0])
					puntos_y.append(I.segmento[i].vertice[j][1])
		#Se criban los puntos para evitar  duplicados 
		p_x=[]
		p_y=[]
		for i in range(len(puntos_x)):
			if len(p_x)==0:
				p_x.append(puntos_x[i])
				p_y.append(puntos_y[i])
			else:
				agregar=1
				for j in range(len(p_x)):
					if  p_x[j]==puntos_x[i] and p_y[j]==puntos_y[i]:
						agregar=0
				if agregar==1:
					p_x.append(puntos_x[i])
					p_y.append(puntos_y[i]) 
		v_pxy=[]
		for i in  range(len(p_x)):
			v_pxy.append([i+1,p_x[i],p_y[i]])
		for i in range(max_seg):
			I.segmento[i]._CargaPunto(v_pxy)
		#Se obtienen los  datos de xy del feed

		feed_xy=[]
		c1=[0.0,0.0]
		c2=[0.0,0.0]
		for i in  range(2):
			for j in range(2):
				tmp1=(1.0*I.segmento[feed_prueba+1].cruz[i][0]-1.0*I.segmento[feed_prueba-1].cruz[j][0])**2.0
				tmp2=(1.0*I.segmento[feed_prueba+1].cruz[i][1]-1.0*I.segmento[feed_prueba-1].cruz[j][1])**2.0
				tmp3=math.sqrt(tmp1+tmp2)
				if len(feed_xy)==0:
					feed_xy.append([tmp3,i,j])
				else:
					if  tmp3<feed_xy[0][0]:
						feed_xy[0][0]=tmp3
						feed_xy[0][1]=i
						feed_xy[0][2]=j
						c1[0]=[1.0*I.segmento[feed_prueba+1].cruz[i][0],1.0*I.segmento[feed_prueba+1].cruz[i][1]]
						c2[0]=[1.0*I.segmento[feed_prueba-1].cruz[j][0],1.0*I.segmento[feed_prueba-1].cruz[j][1]]

		#Se arman las  matrices
		#Matriz de Puntos
		matriz_p="p=["
		for i in range(len(p_x)):
			matriz_p+=" %.10f " %(p_x[i]/escala_abs)
		matriz_p+=" ; "
		for i in range(len(p_x)):
			matriz_p+=" %.10f " %(p_y[i]/escala_abs)
		matriz_p+=" ];\n "

		#Matriz de triangulos
		matriz_t="t = ["
		for k in range(3): # Se leen los  3 vertices de los  triangulos 
			for i in range(max_seg): #numero de segmentos 
				for j in range(2): #numero de triangulos 
					if I.segmento[i].triangulo_puntos[j][k]!=-10000: #
						matriz_t+=" %d "   %(I.segmento[i].triangulo_puntos[j][k])
			matriz_t+=" ; "

		for i in range(max_seg): #numero de segmentos 
			for j in range(2): #numero de triangulos 
				if i<feed_prueba:
					matriz_t+=" %d "   %(1)
				elif i>feed_prueba :
					matriz_t+=" %d "   %(2)
		matriz_t+=" ];\n "
		a="""%This file was generated by peano_antenas which can be downloaded at https://github.com/moroyoqui100/PEANOANTENNAS.
		%written by R.P. Moroyoqui\n"""
		tit= open(nombre, 'w')
		tit.write(a)
		tit.write(matriz_p)
		tit.write(matriz_t)
		tit.write("antenna=customAntennaMesh(p,t);\n")	
		tit.write("createFeed(antenna,[ %.10f, %.10f],[%.10f,%.10f]);\n " %( c1[0][0]/escala_abs,c1[0][1]/escala_abs,c2[0][0]/escala_abs,c2[0][1]/escala_abs))
		tit.close()


